import React from "react";
import { Routes, Route } from "react-router-dom";
import Detail from "./routes/Detail";
import Home from "./routes/Home";

function App() {
  return (
    <Routes>
      <Route exact path="/" comments={Home} />
      <Route path="/:id" comments={Detail} />
    </Routes>
  );
}

export default App;
